import React from 'react';
import './TrailersLanding.css';
import Navigation from './Navigation/Navigations';
import Narcos from '../narcos.png';


function Landing(props){

    return(
        <div className='header-one'>
        <Navigation />
        <div className="narcos">
        <img src={Narcos}  alt="narcos"/>
        <div className="about">
        <p>{props.description}</p>
        </div>
        <div className="a-group">
      <a href ="/" onClick={props.genre}>Watch Now</a>
      </div>
        

        </div>
        {/* <div className="header">
        <h1>{props.name}</h1>
        
      <h3>{props.title}</h3>
      <div className="a-group">
      <a href ="/" onClick={props.genre}>Watch Now</a>
      </div>
      
      
       
       
        
        </div> */}
    
        </div>
        
    )
};
Landing.defaultProps = {
    title: 'Season 2 now available!',
    description: 'Narcos is an American crime drama web television series created and produced by<br /> Chris Brancato, Carlo Bernard, and Doug Miro.Set and filmed in Colombia,<br /> seasons one and two are based on the story of drug kingpin Pablo Escobar,<br /> who became a billionaire through the production and distribution of cocaine.',
  }

export default Landing;
